        padding: 3px;
        background-image: rgba(0, 0, 0, 1);
        background-clip: text;
        -webkit-background-clip: text;
        -webkit-text-fill-color: transparent;
    }

    &__input:checked {
        &+.checkbox__check-icon {
            background-image: $color-purple-gradient;
            border-color: $color-purple;
        }
    }
}

.label-check {
    display: block;
    margin-bottom: 12px;
    min-width: 200px;
    cursor: pointer;
    margin-left: 30px;
    position: relative;
    font-weight: normal;
    font-size: 14px;
    line-height: 18px;
    color: $color-ds50;
}

/* Cкрываем стандартный чекбокс */
.label-check__input {
    display: none;
}

/* Новый чекбокс */
.label-check__new-input {
    position: absolute;
    left: -30px;
    top: -1px;
    font-family: Montserrat;
    font-style: normal;
    font-weight: normal;
    font-size: 14px;
    line-height: 18px;
    color: $color-ds50;
    width: 20px;
    height: 20px;

    background: #FFFFFF;

    border: 1px solid $color-ds25;
    box-sizing: border-box;
    border-radius: 4px;
}

/* Новый чекбокс при выборе */
.label-check__input:checked+.label-check__new-input {
    border-color: $color-purple;

    .check-item {
        display: block;
    }
}

.check-item {
    display: none;
    position: absolute;
    top: 4px;
    left: 6px;
    width: 6px;
    height: 8px;
    border-right: 2px solid transparent;
    border-bottom: 2px solid transparent;
    transform: rotate(45deg);
    border-image: $color-purple-gradient;
    -moz-border-image: $color-purple-gradient;
    -webkit-border-image: $color-purple-gradient;
    border-image-slice: 1;
